import Navbar from './Components/Navbar/Navbar';
import {BrowserRouter,Routes,Route} from"react-router-dom";
import Home from './Components/Home/Home';
function App() {
  return (
    <BrowserRouter>
    <Routes>

     <Route path="/" element={<Navbar/>}/>
     <Route path="/home" element={<Home/>}/>

     </Routes>
     </BrowserRouter>
  );
}

export default App;
